import './header.css';
import { ReactComponent as Logo } from '../images/symbol.svg';

function Header() {
  return (
    <header className='Header'>
      <Logo className='logo' alt='brand' />
      <hr className='change' />
      <div className='options'>
        <button>
          <i></i>
        </button>
        <button>
          <i></i>
        </button>
      </div>
    </header>
  );
}

export default Header;
